import './CSS/Neuigkeiten.css';

export default function Impressum(){
    document.title = "FBG Bremen - Impressum";

    return (
        <>
            <Title title="Impressum"/>
            
            <p>Zum Beispiel:</p>
            <br/>
        </>
    );
}
